The @indexed directive adds an index to the underlying database column for the indicated field of that type. Generally, an index is a data structure that allows you to quickly locate data without having to search each row in a database table. schema { query: QueryRoot
} type QueryRoot { book: Book library: Library
} type Book { id: ID! name: Bytes8! @indexed
} type Library { id: ID! book: Book!
} In this example, a single BTREE INDEX constraint will be created on the book table's name column, which allows for faster lookups on that field. Important: At the moment, index constraint support is limited to BTREE in Postgres with ON DELETE, and ON UPDATE actions not being supported. Note that @indexed directives are also available using SQLite. Finally, multi-column indices are not supported at this time.

