The @unique directive adds a UNIQUE database constraint to the underlying database column for the indicated field of that type. A constraint specifies a rule for the data in a table and can be used to limit the type of data that can be placed in the table. In the case of a column with a UNIQUE constraint, all values in the column must be different. schema { query: QueryRoot
} type QueryRoot { book: Book library: Library
} type Book { id: ID! name: Bytes8! @unique
} type Library { id: ID! book: Book!
} A UNIQUE constraint will be created on the book table's name column, ensuring that no books can share the same name. Important: When using explict or implicit foreign keys, it is required that the reference column name in your foreign key relationship be unique. ID types are by default unique, but all other types will have to be explicitly specified as being unique via the @unique directive.

